      SELECT DISTINCT COUNT ( * ) * + - 17 + + COUNT ( * ) AS col0 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q529.out
    data: |
      -144
